import React from 'react';
import { Layout } from 'antd';
import mySvg from '../icons/calendar.svg';

const Header = () => {
  return (
      <Layout.Header>
        <p style={{color: 'white'}}>Timeline de compras</p>
        <img src={mySvg} />
      </Layout.Header>
  );
};

export default Header;
